import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import reportWebVitals from './reportWebVitals';
import DataTypeBasic from "./21_01_28/DataTypeBasic";
import DataType from "./21_01_28/DataType";
import StringDataType from "./21_01_28/StringDataType";
import RealDataType from "./21_01_28/RealDataType";
import ExpDataType from "./21_01_28/ExpDataType"
import HwFor from "./homework01_28/HwFor"

ReactDOM.render(
  <React.StrictMode>
    <DataTypeBasic/>
    <DataType/>
    <StringDataType/>
    <RealDataType/>
    <ExpDataType/>
    <HwFor/>
    <RandomMember/>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
